/**
 * @param {string} sStr
 * @param {string} tStr
 * @return {character}
 */
var findTheDifference = function (sStr, tStr) {
  const hasMapT = new Map();

  for (let i = 0; i < tStr.length; i++) {
    hasMapT.set(tStr[i], (hasMapT.get(tStr[i]) || 0) + 1);
  }

  for (let i = 0; i < sStr.length; i++) {
    const value = hasMapT.get(sStr[i]);
    if (value > 0) {
      hasMapT.set(sStr[i], value - 1);
    }
  }

  for (const [key, value] of hasMapT) {
    if (value === 1) {
      return key;
    }
  }
};

